const defaultState={
  like:10
}

export const likeReducer =(state=defaultState,action) =>{
  switch(action.type){

    case 'addLike':
      return {...state, like:state.like+action.number}

    case 'removeLike':
      return {...state, like:state.like-action.number}

    default:
      return state
  }
}
